import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';


import Content from "./component/content/Content";
import Header from "./component/header/Header";


function App() {
  return (
    <div className="App">
            <Router className="router">
            <Header />
                <Routes>
                  <Route path="/product/all" exact component= {Content} />
                  <Route path="/product/tech" exact component= {Content} />
                  <Route path="/product/clothes" exact component= {Content} />
                </Routes>
          </Router>
    </div>
  );
}

export default App;
